    return (
        <nav>
            <div class="nav-wrapper">
                <a href="/signin" class="brand-logo">Logo</a>
                <ul id="nav-mobile" class="right hide-on-med-and-down">
                    <li><a href="/signin">Sass</a></li>
                    <li><a href="/signin">Components</a></li>
                    <li><a href="/signin">JavaScript</a></li>
                </ul>
            </div>
        </nav>

    )
}

export default Navbar;
